import React from 'react';

class AddFishForm extends React.Component {
	render() {
		return (
            <form>
                <input name="name" type="text" placeholder="Name"/>
                <input price="name" type="text" placeholder="Price"/>
                <input status="name" type="text" placeholder="Status"/>
                <input description="name" type="text" placeholder="Description"/>
                <input image="name" type="text" placeholder="Image"/>
            </form>
        )
	}
}

export default AddFishForm;
